import React, { useEffect, useState } from 'react';

const FreshworksForm = () => {
  const [isScriptLoaded, setIsScriptLoaded] = useState(false);
  const [error, setError] = useState(null);

  useEffect(() => {
    const script = document.createElement('script');
    script.src = 'https://northernlionlabs.myfreshworks.com/crm/sales/web_forms/878096a47237ef12a6f963047c297e7e09645dcba8490d9b0e631e7eab0e9385/form.js';
    script.async = true;
    script.crossOrigin = 'anonymous';
    script.id = 'fs_878096a47237ef12a6f963047c297e7e09645dcba8490d9b0e631e7eab0e9385';

    script.onload = () => {
      console.log('Freshworks script loaded successfully');
      setIsScriptLoaded(true);
    };

    script.onerror = () => {
      console.error('Failed to load Freshworks script');
      setError('Failed to load the form. Please try again later.');
    };

    document.body.appendChild(script);

    return () => {
      document.body.removeChild(script);
    };
  }, []);

  if (error) {
    return <div>Error: {error}</div>;
  }

  return (
    <div>
      <div id="freshworks-container"></div>
      {!isScriptLoaded && <div>Loading form...</div>}
    </div>
  );
};

export default FreshworksForm;
